import React from "react";
import { Paper } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import "../card/card.css";
import { Typography } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    root: {
      display: 'flex',
      flexWrap: 'wrap',
      '& > *': {
        margin: theme.spacing(1),
        width: theme.spacing(16),
        height: theme.spacing(16),
      },
    },
  }));

export default function Card(){ //add props
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Paper elevation={3} class="paper">
                <Typography align="center">Level</Typography>
                <Typography align="center" variant="h4">Question</Typography>
                <Typography align="center" variatn="h7">Strangers Or Not</Typography>
            </Paper>
        </div>
    )
};
